   const ctx = useContext(AuthContext)
   
    const items= props.onSendData.map((item,index)=>{
        return <li id={index} className={classes.list}>{item.name} -  {item.description} - {item.price} 
        <Input/>
        </li>
    })
    ctx.addItem(items)
    return(
        <div>
   <ul>
    {/* {props.onSendData.map((item, index) =>{
